import { NavWrap, NavItem } from "./Nav.styles";

function Nav(menu) {
    return(
        <NavWrap>
            {menu.map(item => {
                <NavItem>item.title</NavItem>
            })}
        </NavWrap>
    );
}

export default Nav;
